176	88	46	Samsung Galaxy Xcover 3	Gut gewappnet Raue Umgebungen oder staubige Luft, für diese Herausforderungen zeigt sich das SAMSUNG GALAXY Xcover 3 gut gewappnet. Es bietet nicht nur Schutz vor kleinen Staubteilchen, sondern übersteht auch unbeschadet Stürze aus einer Höhe von bis zu 1,2 Metern* (MIL-STD 810G). Zudem ist es gemäß IP67-Zertifizierung staub- und wassergeschützt bis zu einem Meter Wassertiefe und 30 Minuten** Dauer. Mit gerade einmal 9,95 Millimeter und 154 Gramm ist es für ein Outdoor-Smartphone verblüffend schlank und fällt durch sein elegantes Design auf. Trotz der kompakten Maße bietet das GALAXY Xcover 3 viele technische Raffinessen. Haptische Bedienelemente – Home-, Menü- und Zurückknöpfe – erleichtern die Nutzung unter widrigen Bedingungen wie Feuchte oder Kälte. Die neue Xcover-Taste ermöglicht den Sofortzugriff auf wichtige Funktionen: Drücken Nutzer einmal kurz darauf, aktivieren Sie beispielsweise das LED-Licht, um sich auch im Dunkeln zu orientieren. Ein langer Knopfdruck öffnet unmittelbar die Kamera, damit Nutzer spontane Fotogelegenheiten nicht verpassen – und das nicht nur im Trockenen. Der Unterwassermodus erlaubt bei kleinen Tauchgängen Aufnahmen von unvergesslichen Momenten. GALAXY Xcover 3: Steckt viel ein, sieht schick aus.	[]	t	2017-06-02 12:17:11.573676	2017-06-02 12:17:11.573698
