199	100	66	TomTom Multi-Sport Cardio	Multi-platform compatibility Get accurate heart-rate information without the need for a separate chest strap. Your heart rate is measured through a sensor in the watch that monitors changes in the blood flow in your wrist. This is done by shining light through the skin and detecting the changing light reflections. See real-time running, cycling and swimming information at a glance. Track your distance, time, pace, speed and calories burnt as you train on an extra-large display. Select a zone to match your training goal and always know whether you need to speed up or slow down.Heart rate monitoring is the single most accurate means to understand how your body is responding to exercise.	[]	t	2017-06-02 12:17:12.00378	2017-06-02 12:17:12.003801
200	100	46	TomTom Multi-Sport Cardio	Innovative Technologie Erhalten Sie genaue Informationen zu Ihrer Herzfrequenz, ohne einen separaten Brustgurt tragen zu müssen. Ihre Herzfrequenz wird mithilfe eines Sensors in der Uhr gemessen, der Änderungen des Blutflusses an Ihrem Handgelenk feststellt. Dabei wird Licht durch die Haut geleitet, um Veränderungen bei den Lichtreflexionen festzustellen. Sehen Sie Echtzeitinformationen zu Ihrem Lauf, Ihrer Rad- und Schwimmeinheit auf einen Blick. Verfolgen Sie Ihre Distanz, Zeit, Ihr Tempo, Ihre Geschwindigkeit und Ihre verbrannten Kalorien während des Trainings auf einem extragroßen Display. Unabhängige Tests ergaben, dass der eingebaute Herzfrequenzmesser im Vergleich zur Elektrokardiografie „extrem präzise“ arbeitet. Die Überwachung der Herzfrequenz ist die beste Methode, um zu verstehen, wie Ihr Körper auf das Training reagiert.	[]	t	2017-06-02 12:17:12.005602	2017-06-02 12:17:12.00562
